'use client';

import { Layer, Group, Rect, Text } from 'react-konva';
import {
  useKonvaContext,
  KonvaProvider,
  FullWidthStage,
  Image,
  Heart,
} from '~/features/konva';
import { composeProviders } from '~/utils/hoc';
import { Controls } from '../Controls';
import { ProgressBar } from '../ProgressBar';
import { Repeat } from '../Repeat';
import { Share } from '../Share';

const url =
  'data:image/jpeg;base64,';

/**
 * spotify frame
 */
export const SpotifyFrame = composeProviders(KonvaProvider)((): JSX.Element => {
  const { relativeX, relativeY } = useKonvaContext();
  const base = 1000;
  const width = relativeX(base);
  const height = relativeY(base);
  const padding = relativeX(100);
  const fullWidth = width - padding * 2;
  const imageMargin = relativeX(75);
  const imageWidth = fullWidth - imageMargin * 2;
  const headingFontSize = relativeX(50);
  const iconWidth = relativeX(25);

  return (
    <FullWidthStage base={base} aspectRatio={3 / 4}>
      <Layer>
        <Rect width={width} height={height} fill='#ffffff' />
        <Group x={padding}>
          <Image
            src={url}
            x={imageMargin}
            y={padding}
            width={imageWidth}
            height={imageWidth}
            cornerRadius={5}
          />
          <Group y={relativeY(625)}>
            <Group>
              <Text
                text="We're getting married!"
                fontFamily='Roboto'
                fontSize={headingFontSize}
                fontStyle='700'
              />
              <Group y={headingFontSize + relativeY(15)}>
                <Text
                  text='John and Jane'
                  fontFamily='Roboto'
                  fontSize={headingFontSize * 0.5}
                  fontStyle='400'
                  fill='rgb(156 163 175)' // text-gray-400
                />
                <Heart
                  x={fullWidth - iconWidth * 2}
                  y={(iconWidth - headingFontSize) / 2}
                  width={iconWidth}
                  fill='rgb(244 114 182)' // text-pink-400
                />
              </Group>
            </Group>
            <Group y={relativeY(100)}>
              <ProgressBar
                width={fullWidth}
                height={relativeY(5)}
                fill='#000000'
                now='4.28.2024'
                duration=''
                at={0.33}
                fontSize={relativeX(20)}
              />
              <Controls
                x={fullWidth * 0.5}
                y={relativeY(100)}
                radius={relativeX(50)}
              />
              <Group y={relativeY(175)}>
                <Repeat width={iconWidth} fill='#000000' />
                <Share
                  x={fullWidth - iconWidth * 2}
                  width={iconWidth}
                  fill='#000000'
                />
              </Group>
            </Group>
          </Group>
        </Group>
      </Layer>
    </FullWidthStage>
  );
});
